■重要【ご購入前に必ずご確認ください】<br>※メーカー直送品につき代引決済・他の商品との同梱ができません<br>※沖縄・一部離島は別途送料がかかります。お見積もりいたしますのでお問い合わせ下さい。<br>※商品出荷後の、不良品以外のキャンセル・返品・交換はできませんのでご注意ください<br>※商品写真の色味は、ご使用の端末の設定等により実際のものと異なってしまう場合があります。予めご了承の程、お願い申し上げます。<br>※メーカー直送のため代金引換はお受けできません。<br> ※沖縄・一部離島は別途送料がかかります。お見積もりいたしますのでお問い合わせ下さい。<br>商品について：驚異の忌避率91.4％☆イヤなダニを寄せ付けない特殊加工をした防ダニシートSサイズ。布団やマットレスの下に敷くだけで防ダニ効果があります。寝具は洗えなかったり、頻繁に洗濯することが大変！ダニロックはシートタイプなので簡単。ご家庭の洗濯機（ネット使用）で洗って繰り返しお使いいただけます。忌避効果は洗濯10回以上持続します。<br>※アレルギーテスト済ですが、すべての方にアレルギーがおこらないということではありません。肌に直接触れないようご注意ください。<br>サイズ（cm）：幅95x奥行140cm・約0.1kg<br>材質：本体-ポリエステル100％（防ダニ加工済み）<br>完成品<br>日本製<br>(12600008)<!--must8.31--><style type="text/css">
