【商品説明】<br>特殊和紙包装でラクラク衣替え<br>切らずに使えて手間いらず<br>切らずにそのまま使えて、薬剤が直接衣類にふれず安心です。<br>和紙の全面からムラなく揮散<br>全面から防虫薬剤が広がる揮散方式なので、容器のすみずみまで、しっかり防虫します。<br>季節に応じた防虫効果<br>特殊フィルムが多層に重なっているので、夏期・冬期をとわずに防虫効果を発揮します。<br>衣類をカビからも守る<br>防カビ効果でカビの発育を抑えます。<br><br>商品サイズ：170×290×63<br><br>成分：パラジクロルベンゼン、香料<br><br>ご使用上の注意等：●パッケージに記載されている使用量を守って使用する。<br>●タンス・衣装ケースなどの密閉性のある収納容器で使用する。<br>●衣類の入れ替えをする時は、部屋の換気をする。<br>●幼児の手の届くところに置かない。<br>●本品は食べられない。万一食べた時には医師に相談する。<br>●誤食などの対応のため、使用中はこのパッケージを保管する。<br>●ナフタリンまたはしょう脳との併用は避けること。溶けて衣類にシミを残すことがある。<br>●塩化ビニール製のバッグ、スチロール製の人形及びアクリル製のブローチなどのプラスチック製品に使用しない。本剤におかされ変形することがある。<br>●有効期間：使用開始後　約４～６ヵ月<br>（温度、収納容器及び使用状態などで一定しない。）<br>夏期は薬剤の残量を早めに見て補給すること。<br>●気温の変化などで、まれに袋の中に結晶状の防虫成分が付着していることがあるが、防虫剤の品質および使用に問題はない。また、使用中まれに防虫成分が衣類に粉状または再結晶になって付くことがあるが、シミ・変色などの心配はない。風通しのよいところに吊るしておくと自然にとれるので、もんだり、こすったり、無理にとらない。<br>●使用後は、地域のゴミ捨て規則に従って捨てる。<br>●用途以外には使用しない。（防力ビ効果は、せんい製品防虫剤の用途で使用した場合の効果です。）<br><br>原産国：日本<br><br>問い合わせ先：エステー株式会社　〒161-8540東京都新宿区下落合1-4-10　お客様相談室　TEL03-3367-2147　<br>商品区分：衣類用防虫剤<br>JANコード：4901070302932<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<style>
